var title_f42_37_43611="Causes of insulin resistance";
var content_f42_37_43611=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F75383&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F75383&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major causes of insulin resistance",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Inherited states of target cell resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leprechaunism (insulin-receptor mutations)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rabson-Mendenhall syndrome (insulin-receptor mutations)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Type A syndrome of insulin resistance (insulin-receptor mutations in some, unknown signalling defect in most)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Some lipodystrophies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Secondary insulin resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obesity (free fatty acids and adipocytokines may contribute)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excess counterregulatory hormones (glucocorticoids, catecholamines, growth hormone, placental lactogen)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Type 2 diabetes mellitus (secondary to obesity and other factors)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inactivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stress, infection (counterregulatory hormones)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pregnancy (placental lactogen)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immune mediated (anti-insulin antibodies, anti-insulin receptor antibodies in type B syndrome)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Miscellaneous (starvation, uremia, cirrhosis, ketoacidosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Multifactorial etiology of insulin resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypertension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polycystic ovary syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metabolic syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Most cases of type 2 diabetes mellitus",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
