var title_f42_37_43612="Strategies for assisting adolescents with smoking cessation";
var content_f42_37_43612=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72703&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72703&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Strategies for assisting adolescent patients with smoking cessation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Action",
"      </td>",
"      <td class=\"subtitle1\">",
"       Strategies for implementation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"4\">",
"       Help the patient with a quit plan",
"      </td>",
"      <td>",
"       Set a quit date. Ideally, the quit date should be within two weeks. For patients who have difficulty with this type of \"all-or-nothing\" approach, it is reasonable to develop a strategy of cutting down gradually, in anticipation of a quit date further in the future.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tell family, friends, and coworkers about quitting and request understanding and support.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Anticipate challenges to planned quit attempt, particularly during the critical first few weeks. These include nicotine withdrawal symptoms.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Remove tobacco products from your environment. Prior to quitting, avoid smoking in places where you spend a lot of time (eg, work, home, car).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"5\">",
"       Provide practical counseling (problem solving/training)",
"      </td>",
"      <td>",
"       Abstinence - Total abstinence is essential. \"Not even a single puff after the quit date.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Past quit experience - Review past quit attempts including identification of what helped during the quit attempt and what factors contributed to relapse.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Anticipate triggers or challenges in upcoming attempt - Discuss challenges/triggers (such as school pressures, parties, or feelings of boredom or depression) and how patient will successfully overcome them.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Alcohol, marijuana, and other drugs - Because these can cause relapse, the patient should consider limiting/abstaining from their use while quitting. Health care providers should discuss the use/abuse of these substances and plans for changing behavior.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Other smokers in the household - Quitting is more difficult when there is another smoker in the household. Patients should encourage family members or roommates to quit with them or not smoke in their presence.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Provide intra-treatment social support",
"      </td>",
"      <td>",
"       Provide a supportive clinical environment while encouraging the patient in his or her quit attempt. \"My office staff and I are available to assist you.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Help the patient obtain extra-treatment social support",
"      </td>",
"      <td>",
"       Help the patient develop social support for his or her quit attempt in his or her environments outside of treatment. \"Ask your boyfriend/girlfriend, friends, and family to support you in your quit attempt.\"",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Recommend the use of approved pharmacotherapy, except in special circumstances",
"      </td>",
"      <td>",
"       Recommend the use of pharmacotherapies found to be effective. Explain how these medications increase smoking cessation success and reduce withdrawal symptoms. Discuss the proper use of these medications; review their use at future visits.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Provide supplementary materials",
"      </td>",
"      <td>",
"       Sources - Federal agencies, nonprofit agencies, or local/state health departments, eg, 1-800-QUITNOW (1800quitnow.cancer.gov), www.notobacco.org, or www.tobaccofree.org/children.htm.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Type - Have printed materials on hand in clinical setting; provide web addresses or Quitline phone numbers. Materials should be culturally, racially, educationally and age-appropriate for the patient.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Flore, MC, Bailey, WC, Cohen, SJ, et al. Treating Tobacco Use and Dependence. Public Health Service, US Dept of Health and Human Services, 2000.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
